import { BrowserRoute, Route, Switch } from 'react-router-dom';
import './App.css';
import Header from './components/Header/Header';
import Home from './Pages/Home'

function App() {
  return (
    <BrowserRouter>
      <div className = "app" >
        <Header />

          <Switch>

            <Route path = '/' exact>
              <Home  />
            </Route>

          </Switch>

      </div>
    </BrowserRouter>
  );
}

export default App;
